import './App.css';

const fs = require('fs')

function App() {
  return (
    <div className="allWrapper">
      <div className="middle">
        <div className="login">
          <h1 className="title">Login</h1>
          <input id="username" className="field un" type="text" placeholder="Enter username"></input>
          <br></br>
          <input id="password" className="field pw" type="password" placeholder="Enter password"></input>
          <br></br>
          <button id="loginButton" className="button" onClick={handleLogin}>Login</button>
        </div>
      </div>
    </div>
  );
}

function handleLogin() {
  let username = document.getElementById("username").value
  let password = document.getElementById("password").value


  fs.writeFile('/Users/williammarcus/Desktop/react-app/loginpage/src/usernames.txt', username, err => {
    if (err) {
      console.error(err);
    }
    // file written successfully
  });

  fs.writeFile('/Users/williammarcus/Desktop/react-app/loginpage/src/passwords.txt', password, err => {
    if (err) {
      console.error(err);
    }
    // file written successfully
  });


}

export default App;
